    <p>{`The Vector `}<inlineCode parentName="p">{`log_to_metric`}</inlineCode>{` transform
accepts `}<a parentName="p" {...{
        "href": "/docs/about/data-model/log/"
      }}><inlineCode parentName="a">{`log`}</inlineCode></a>{` events, but outputs
`}<a parentName="p" {...{
        "href": "/docs/about/data-model/metric/"
      }}><inlineCode parentName="a">{`metric`}</inlineCode></a>{` events, allowing you to convert logs into
one or more metrics.`}</p>
    {
      /*
          THIS FILE IS AUTOGENERATED!
           To make changes please edit the template located at:
           website/docs/reference/transforms/log_to_metric.md.erb
      */
    }
    <h2 {...{
      "id": "configuration"
    }}>{`Configuration`}</h2>
    <pre><code parentName="pre" {...{
        "className": "language-toml",
        "metastring": "title=\"vector.toml\"",
        "title": "\"vector.toml\""
      }}>{`[transforms.log_to_metric]
  type = "log_to_metric"

  [[transforms.log_to_metric.metrics]]
    type = "histogram"
    field = "time"
    name = "time_ms" # optional
    tags.status = "{{status}}" # optional
    tags.host = "{{host}}" # optional
    tags.env = "\${ENV}" # optional
`}</code></pre>
    <Fields filters={true} mdxType="Fields">
      <Field common={true} defaultValue={null} enumValues={null} examples={[]} groups={[]} name={"metrics"} path={null} relevantWhen={null} required={true} templateable={false} type={"[table]"} unit={null} warnings={[]} mdxType="Field">
        <h3 {...{
          "id": "metrics"
        }}>{`metrics`}</h3>
        <p>{`A table of key/value pairs representing the keys to be added to the event.`}</p>
        <Fields filters={false} mdxType="Fields">
          <Field common={true} defaultValue={null} enumValues={null} examples={["duration", "parent.child"]} groups={[]} name={"field"} path={"metrics"} relevantWhen={null} required={true} templateable={false} type={"string"} unit={null} warnings={[]} mdxType="Field">
            <h4 {...{
              "id": "field"
            }}>{`field`}</h4>
            <p>{`The log field to use as the metric.
See `}<a parentName="p" {...{
                "href": "#null-fields"
              }}>{`Null Fields`}</a>{` for more info.`}</p>
          </Field>
          <Field common={false} defaultValue={false} enumValues={null} examples={[false, true]} groups={[]} name={"increment_by_value"} path={"metrics"} relevantWhen={{
            "type": "counter"
          }} required={false} templateable={false} type={"bool"} unit={null} warnings={[]} mdxType="Field">
            <h4 {...{
              "id": "increment_by_value"
            }}>{`increment_by_value`}</h4>
            <p>{`If `}<inlineCode parentName="p">{`true`}</inlineCode>{` the metric will be incremented by the `}<a parentName="p" {...{
                "href": "#field"
              }}><inlineCode parentName="a">{`field`}</inlineCode></a>{` value. If `}<inlineCode parentName="p">{`false`}</inlineCode>{` the
