            <h4 {...{
              "id": "name"
            }}>{`name`}</h4>
            <p>{`The name of the metric. Defaults to `}<inlineCode parentName="p">{`<field>_total`}</inlineCode>{` for `}<inlineCode parentName="p">{`counter`}</inlineCode>{` and `}<inlineCode parentName="p">{`<field>`}</inlineCode>{`
for `}<inlineCode parentName="p">{`gauge`}</inlineCode>{`.`}</p>
          </Field>
          <Field common={true} defaultValue={null} enumValues={null} examples={[]} groups={[]} name={"tags"} path={"metrics"} relevantWhen={null} required={false} templateable={false} type={"table"} unit={null} warnings={[]} mdxType="Field">
            <h4 {...{
              "id": "tags"
            }}>{`tags`}</h4>
            <p>{`Key/value pairs representing `}<a parentName="p" {...{
                "href": "/docs/about/data-model/metric/#tags"
              }}>{`metric tags`}</a>{`.`}</p>
            <Fields filters={false} mdxType="Fields">
              <Field common={true} defaultValue={null} enumValues={null} examples={[{
                "host": "${HOSTNAME}"
              }, {
                "region": "us-east-1"
              }, {
                "status": "{{status}}"
              }]} groups={[]} name={"`[tag-name]`"} path={"metrics.tags"} relevantWhen={null} required={true} templateable={false} type={"string"} unit={null} warnings={[]} mdxType="Field">
                <h5 {...{
                  "id": "tag-name"
                }}><inlineCode parentName="h5">{`[tag-name]`}</inlineCode></h5>
                <p>{`Key/value pairs representing `}<a parentName="p" {...{
                    "href": "/docs/about/data-model/metric/#tags"
                  }}>{`metric tags`}</a>{`.
Environment variables and field interpolation is allowed.`}</p>
              </Field>
            </Fields>
          </Field>
          <Field common={true} defaultValue={null} enumValues={{
            "counter": "A [counter metric type][docs.data-model.metric#counter].",
            "gauge": "A [gauge metric type][docs.data-model.metric#gauge].",
            "histogram": "A [distribution metric type][docs.data-model.metric#distribution].",
            "set": "A [set metric type][docs.data-model.metric#set]."
          }} examples={["counter", "gauge", "histogram", "set"]} groups={[]} name={"type"} path={"metrics"} relevantWhen={null} required={true} templateable={false} type={"string"} unit={null} warnings={[]} mdxType="Field">
            <h4 {...{
              "id": "type"
            }}>{`type`}</h4>
            <p>{`The metric type.`}</p>
          </Field>
        </Fields>
      </Field>
    </Fields>
    <h2 {...{
      "id": "examples"
    }}>{`Examples`}</h2>
    <Tabs block={true} defaultValue="histograms" select={false} values={[{
      "label": "Histograms",
      "value": "histograms"
    }, {
      "label": "Counts",
      "value": "counts"
    }, {
      "label": "Sums",
      "value": "sums"
    }, {
      "label": "Gauges",
      "value": "gauges"
    }, {
      "label": "Set",
      "value": "set"
    }]} mdxType="Tabs">
      <TabItem value="histograms" mdxType="TabItem">
        <p>{`This example demonstrates capturing timings in your logs.`}</p>
        <pre><code parentName="pre" {...{
            "className": "language-json",
            "metastring": "title=\"log event\"",
            "title": "\"log",
            "event\"": true
          }}>{`{
  "host": "10.22.11.222",
  "message": "Sent 200 in 54.2ms",
  "status": 200,
  "time": 54.2,
}
`}</code></pre>
        <p>{`You can convert the `}<inlineCode parentName="p">{`time`}</inlineCode>{` field into a `}<inlineCode parentName="p">{`distribution`}</inlineCode>{` metric:`}</p>
        <pre><code parentName="pre" {...{
            "className": "language-toml",
            "metastring": "tite=\"vector.toml\"",
            "tite": "\"vector.toml\""
          }}>{`[transforms.log_to_metric]
  type = "log_to_metric"

  [[transforms.log_to_metric.metrics]]
    type = "histogram"
    field = "time"
    name = "time_ms" # optional
    tags.status = "{{status}}" # optional
    tags.host = "{{host}}" # optional
`}</code></pre>
        <p>{`A `}<a parentName="p" {...{
            "href": "/docs/about/data-model/metric/"
          }}><inlineCode parentName="a">{`metric`}</inlineCode>{` event`}</a>{` will be output with the following
structure:`}</p>
        <pre><code parentName="pre" {...{
            "className": "language-javascript",
            "metastring": "title=\"metric event\"",
            "title": "\"metric",
            "event\"": true
          }}>{`{
  "name": "time_ms",
  "kind": "incremental",
  "tags": {
    "status": "200",
    "host": "10.22.11.222"
  }
  "distribution": {
    "values": [54.2],
    "sample_rates": [1.0]
  }
}
`}</code></pre>
        <p>{`This metric will then proceed down the pipeline, and depending on the sink,
will be aggregated in Vector (such is the case for the `}<a parentName="p" {...{
            "href": "/docs/reference/sinks/prometheus/"
          }}><inlineCode parentName="a">{`prometheus`}</inlineCode>{` sink`}</a>{`) or will be aggregated in the store itself.`}</p>
      </TabItem>
      <TabItem value="counts" mdxType="TabItem">
        <p>{`This example demonstrates counting HTTP status codes.`}</p>
        <p>{`Given the following log line:`}</p>
        <pre><code parentName="pre" {...{
            "className": "language-json",
            "metastring": "title=\"log event\"",
            "title": "\"log",
            "event\"": true
          }}>{`{
  "host": "10.22.11.222",
  "message": "Sent 200 in 54.2ms",
  "status": 200
}
`}</code></pre>
        <p>{`You can count the number of responses by status code:`}</p>
        <pre><code parentName="pre" {...{
            "className": "language-toml",
            "metastring": "title=\"vector.toml\"",
            "title": "\"vector.toml\""
          }}>{`[transforms.log_to_metric]
  type = "log_to_metric"

  [[transforms.log_to_metric.metrics]]
    type = "counter"
    field = "status"
    name = "response_total" # optional
    tags.status = "{{status}}"
    tags.host = "{{host}}"
`}</code></pre>
        <p>{`A `}<a parentName="p" {...{
            "href": "/docs/about/data-model/metric/"
          }}><inlineCode parentName="a">{`metric`}</inlineCode>{` event`}</a>{` will be output with the following
structure:`}</p>
        <pre><code parentName="pre" {...{
            "className": "language-javascript",
            "metastring": "title=\"metric event\"",
            "title": "\"metric",
            "event\"": true
          }}>{`{
  "name": "response_total",
  "kind": "incremental",
  "tags": {
    "status": "200",
    "host": "10.22.11.222"
  }
  "counter": {
    "value": 1.0,
  }
}
`}</code></pre>
        <p>{`This metric will then proceed down the pipeline, and depending on the sink,
will be aggregated in Vector (such is the case for the `}<a parentName="p" {...{
            "href": "/docs/reference/sinks/prometheus/"
          }}><inlineCode parentName="a">{`prometheus`}</inlineCode>{` sink`}</a>{`) or will be aggregated in the store itself.`}</p>
      </TabItem>
      <TabItem value="sums" mdxType="TabItem">
        <p>{`In this example we'll demonstrate computing a sum. The scenario we've chosen
is to compute the total of orders placed.`}</p>
        <p>{`Given the following log line:`}</p>
        <pre><code parentName="pre" {...{
            "className": "language-json",
            "metastring": "title=\"log event\"",
            "title": "\"log",
            "event\"": true
          }}>{`{
  "host": "10.22.11.222",
  "message": "Order placed for $122.20",
  "total": 122.2
}
`}</code></pre>
        <p>{`You can reduce this log into a `}<inlineCode parentName="p">{`counter`}</inlineCode>{` metric that increases by the
field's value:`}</p>
        <pre><code parentName="pre" {...{
            "className": "language-toml",
            "metastring": "title=\"vector.toml\"",
            "title": "\"vector.toml\""
          }}>{`[transforms.log_to_metric]
  type = "log_to_metric"

  [[transforms.log_to_metric.metrics]]
    type = "counter"
    field = "total"
    name = "order_total" # optional
    increment_by_value = true # optional
    tags.host = "{{host}}" # optional
`}</code></pre>
        <p>{`A `}<a parentName="p" {...{
            "href": "/docs/about/data-model/metric/"
          }}><inlineCode parentName="a">{`metric`}</inlineCode>{` event`}</a>{` will be output with the following
structure:`}</p>
        <pre><code parentName="pre" {...{
            "className": "language-javascript",
            "metastring": "title=\"metric event\"",
            "title": "\"metric",
            "event\"": true
          }}>{`{
  "name": "order_total",
  "kind": "incremental",
  "tags": {
    "status": "200",
    "host": "10.22.11.222"
  }
  "counter": {
    "value": 122.20,
  }
}
`}</code></pre>
        <p>{`This metric will then proceed down the pipeline, and depending on the sink,
will be aggregated in Vector (such is the case for the `}<a parentName="p" {...{
            "href": "/docs/reference/sinks/prometheus/"
          }}><inlineCode parentName="a">{`prometheus`}</inlineCode>{` sink`}</a>{`) or will be aggregated in the store itself.`}</p>
      </TabItem>
      <TabItem value="gauges" mdxType="TabItem">
        <p>{`In this example we'll demonstrate creating a gauge that represents the current
CPU load verages.`}</p>
        <p>{`Given the following log line:`}</p>
        <pre><code parentName="pre" {...{
            "className": "language-json",
            "metastring": "title=\"log event\"",
            "title": "\"log",
            "event\"": true
          }}>{`{
  "host": "10.22.11.222",
  "message": "CPU activity sample",
  "1m_load_avg": 78.2,
  "5m_load_avg": 56.2,
  "15m_load_avg": 48.7
}
`}</code></pre>
        <p>{`You can reduce this logs into multiple `}<inlineCode parentName="p">{`gauge`}</inlineCode>{` metrics:`}</p>
        <pre><code parentName="pre" {...{
            "className": "language-toml",
            "metastring": "title=\"vector.toml\"",
            "title": "\"vector.toml\""
          }}>{`[transforms.log_to_metric]
  type = "log_to_metric"

  [[transforms.log_to_metric.metrics]]
    type = "gauge"
    field = "1m_load_avg"
    tags.host = "{{host}}" # optional

  [[transforms.log_to_metric.metrics]]
    type = "gauge"
    field = "5m_load_avg"
    tags.host = "{{host}}" # optional

  [[transforms.log_to_metric.metrics]]
    type = "gauge"
    field = "15m_load_avg"
    tags.host = "{{host}}" # optional
`}</code></pre>
        <p>{`Multiple `}<a parentName="p" {...{
            "href": "/docs/about/data-model/metric/"
          }}><inlineCode parentName="a">{`metric`}</inlineCode>{` events`}</a>{` will be output with the following
structure:`}</p>
        <pre><code parentName="pre" {...{
            "className": "language-javascript",
            "metastring": "title=\"Metric event 1\"",
            "title": "\"Metric",
            "event": true,
            "1\"": true
          }}>{`{
  "name": "1m_load_avg",
  "kind": "absolute",
  "tags": {
    "host": "10.22.11.222"
  },
  "gauge": {
    "value": 78.2
  }
}
`}</code></pre>
        <pre><code parentName="pre" {...{
            "className": "language-javascript",
            "metastring": "title=\"Metric event 2\"",
            "title": "\"Metric",
            "event": true,
            "2\"": true
          }}>{`{
  "name": "5m_load_avg",
  "kind": "absolute",
  "tags": {
    "host": "10.22.11.222"
  },
  "gauge": {
    "value": 56.2
  }
}
`}</code></pre>
        <pre><code parentName="pre" {...{
            "className": "language-javascript",
            "metastring": "title=\"Metric event 3\"",
            "title": "\"Metric",
            "event": true,
            "3\"": true
          }}>{`{
  "name": "15m_load_avg",
  "kind": "absolute",
  "tags": {
    "host": "10.22.11.222"
  },
  "gauge": {
    "value": 48.7
  }
}
`}</code></pre>
        <p>{`This metric will then proceed down the pipeline, and depending on the sink,
will be aggregated in Vector (such is the case for the `}<a parentName="p" {...{
            "href": "/docs/reference/sinks/prometheus/"
          }}><inlineCode parentName="a">{`prometheus`}</inlineCode>{` sink`}</a>{`) or will be aggregated in the store itself.`}</p>
      </TabItem>
      <TabItem value="set" mdxType="TabItem">
        <p>{`In this example we'll demonstrate how to use sets. Sets are primarly a Statsd
concept that represent the number of unique values seens for a given metric.
The idea is that you pass the unique/high-cardinality value as the metric value
and the metric store will count the number of unique values seen.`}</p>
        <p>{`For example, given the following log line:`}</p>
        <pre><code parentName="pre" {...{
            "className": "language-json",
            "metastring": "title=\"log event\"",
            "title": "\"log",
            "event\"": true
          }}>{`{
  "host": "10.22.11.222",
  "message": "Sent 200 in 54.2ms",
  "remote_addr": "233.221.232.22"
}
`}</code></pre>
        <p>{`You can count the number of unique `}<inlineCode parentName="p">{`remote_addr`}</inlineCode>{` values by using a set:`}</p>
        <pre><code parentName="pre" {...{
            "className": "language-toml",
            "metastring": "title=\"vector.toml\"",
            "title": "\"vector.toml\""
          }}>{`[transforms.log_to_metric]
  type = "log_to_metric"

  [[transforms.log_to_metric.metrics]]
    type = "set"
    field = "remote_addr"
    tags.host = "{{host}}" # optional
`}</code></pre>
        <p>{`A `}<a parentName="p" {...{
            "href": "/docs/about/data-model/metric/"
          }}><inlineCode parentName="a">{`metric`}</inlineCode>{` event`}</a>{` will be output with the following
structure:`}</p>
        <pre><code parentName="pre" {...{
            "className": "language-javascript",
            "metastring": "title=\"metric event\"",
            "title": "\"metric",
            "event\"": true
          }}>{`{
  "name": "remote_addr",
  "kind": "incremental",
  "tags": {
    "host": "10.22.11.222"
  },
  "set": {
    "values": ["233.221.232.22"]
  }
}
`}</code></pre>
        <p>{`This metric will then proceed down the pipeline, and depending on the sink,
will be aggregated in Vector (such is the case for the `}<a parentName="p" {...{
            "href": "/docs/reference/sinks/prometheus/"
          }}><inlineCode parentName="a">{`prometheus`}</inlineCode>{` sink`}</a>{`) or will be aggregated in the store itself.`}</p>
      </TabItem>
    </Tabs>
    <h2 {...{
      "id": "how-it-works"
    }}>{`How It Works`}</h2>
    <h3 {...{
      "id": "complex-processing"
    }}>{`Complex Processing`}</h3>
    <p>{`If you encounter limitations with the `}<inlineCode parentName="p">{`log_to_metric`}</inlineCode>{`
transform then we recommend using a `}<a parentName="p" {...{
        "href": "https://vector.dev/components/?functions%5B%5D=program"
      }}>{`runtime transform`}</a>{`.
These transforms are designed for complex processing and give you the power of
full programming runtime.`}</p>
    <h3 {...{
      "id": "environment-variables"
    }}>{`Environment Variables`}</h3>
    <p>{`Environment variables are supported through all of Vector's configuration.
Simply add `}<inlineCode parentName="p">{`\${MY_ENV_VAR}`}</inlineCode>{` in your Vector configuration file and the variable
will be replaced before being evaluated.`}</p>
    <p>{`You can learn more in the
`}<a parentName="p" {...{
        "href": "/docs/setup/configuration/#environment-variables"
      }}>{`Environment Variables`}</a>{` section.`}</p>
    <h3 {...{
      "id": "multiple-metrics"
    }}>{`Multiple Metrics`}</h3>
    <p>{`For clarification, when you convert a single `}<inlineCode parentName="p">{`log`}</inlineCode>{` event into multiple `}<a parentName="p" {...{
        "href": "#metric"
      }}><inlineCode parentName="a">{`metric`}</inlineCode></a>{`
events, the `}<a parentName="p" {...{
        "href": "#metric"
      }}><inlineCode parentName="a">{`metric`}</inlineCode></a>{` events are not emitted as a single array. They are emitted
individually, and the downstream components treat them as individual events.
Downstream components are not aware they were derived from a single log event.`}</p>
    <h3 {...{
      "id": "null-fields"
    }}>{`Null Fields`}</h3>
    <p>{`If the target log `}<a parentName="p" {...{
        "href": "#field"
      }}><inlineCode parentName="a">{`field`}</inlineCode></a>{` contains a `}<inlineCode parentName="p">{`null`}</inlineCode>{` value it will ignored, and a metric
will not be emitted.`}</p>
    <h3 {...{
      "id": "reducing"
    }}>{`Reducing`}</h3>
    <p>{`It's important to understand that this transform does not reduce multiple logs
into a single metric. Instead, this transform converts logs into granular
individual metrics that can then be reduced at the edge. Where the reduction
happens depends on your metrics storage. For example, the
`}<a parentName="p" {...{
